  false,\n\t\"url\": null,\n\t\"notes\": \"Site: Tarawa Atoll, Republic of Kiribati
  (1 deg N, 172 deg E). Water depth: 2-4m. Coral species Hydnophora microconos. Time
  span: 1959-79 at monthly resolution. Files contains stable isotope data presented
  by Cole and Fairbanks (1990), Mn/Ca data presented by Shen et al. (1992b), and normalized
  d18O data presented by Cole, Fairbanks, and Shen (1993) for the years 1893-1959.
  Stable isotopes were measured on untreated coral samples at Lamont-Doherty Earth
  Observatory by J. Cole and R. Fairbanks, on a Finnigan MAT-251 mass spectrometer
  with automated Carousel-48 carbonate device. Values are in standard per mil notation
  relative to PDB. Isotopic data are given for two corals from the same site, LDGO-39
  and LDGO-44. Measurement precisions are 0.08 for d18O and 0.04 for d13C. Mn/Ca measurements
  were performed at the University of Washington by G. Shen and L. Linn by graphite
  furnace atomic absorption spectrophotometry; only coral LDGO-44 was analyzed for
  Mn/Ca. Sample treatment procedures are described in Shen et al. (1992b). Average
  departures from duplicate means are 1.6nmol Mn/mol Ca. Ages for all samples in this
  file were derived from annual variations in d13C, assumed to correspond with annual
  rainy seasons as described in Cole and Fairbanks (1990).Density banding confirms
  these ages for LDGO-44 samples, but coral LDGO-39 did not exhibit clearly annual
  banding patterns. For Mn/Ca data prior to 1962 in LDGO-44, ages were determined
  by extrapolation based on density band data, as isotopic data only extends to 1962
  in LDGO-44.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
